(16, 'Accountants', 'accountants-near-me', 'The Northern Ireland Connection', '<p style=\"margin-bottom:18.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:19.0pt\"><span inherit=\"\" style=\"font-family:\">Questions To Ask When Looking For an Accountant</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">Accounting services </span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\">Bookkeeping</span></span></b><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">&nbsp;mainly deals with documentation tasks and taxes,&nbsp;required by small and medium sized businesses. </span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">Having an accounting professional can bring several advantages if you run a tiny service or are otherwise self-employed or sole trader.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">At the most standard level, your accountant can will manage vital functions such as accounting and also tax returns. As your business grows, you will need more help with financial reporting, compliance, pay-roll, tax performance, company preparation as well as more.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><u><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">Auditing Services</span></span></u></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">There are 9 main types of audits</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">1. Internal audit</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">2. External audit</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">3. Tax audit</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">4. Financial audit</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">5. Operational audit</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">6. Compliance audit</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">7. Information system audit</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">8. Payroll audit</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">9. Pay audit</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><u><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">Importance of audits</span></span></u></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">You must conduct audits regularly to understand different aspects of your business. And, audits can help catch issues early on before they snowball into big mistakes. If you don&rsquo;t conduct audits, you may find yourself reviewing inaccurate information, which can impact your business later.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">What are the other types of accountants?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">accountancy firms</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">chartered accountants</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">online accountancy</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">accounting services</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">local accountants</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">tax accountant</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">personal tax</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">limited company</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">day to day</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><u><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">Questions to ask an accountant</span></span></u></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:14.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\">1. What do you charge?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:14.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\">2. What services are included in your fees?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 10pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:14.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\">3. Why should I choose you rather than another accountant?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 10pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:14.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\">4. Will you assign a dedicated accountant / contact person to me?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 10pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:14.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\">5. How will we keep in touch?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 10pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:14.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\">6. What issues should we discuss regularly?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 10pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:14.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\">7. Are there any special considerations for my type of business?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 10pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:14.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\">8. What additional services do you provide?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 10pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:14.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\">9. What are the most common mistakes your clients make?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 10pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:14.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\">10. How will you make sure I don&rsquo;t miss deadlines?</span></span></b></span></span></span></p>', '2021-08-13', 'https://www.facebook.com/TheNIConnection/', 'https://twitter.com/theNorthernIre2', 'https://www.instagram.com/thenorthernirelandconnection/', 'https://www.youtube.com/channel/UCY1RtdHHZhNzm0-NV72F7rQ', 'assets/uploads/news/', 'accout1s162886811460.jpg', 'accout1s162886811460.jpg', 1),
(17, 'Classic Trucks', 'classic-trucks', 'The Northern Ireland Connection', '<p align=\"center\" style=\"text-align:center; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:36.0pt\"><span style=\"line-height:107%\">Ulster Commercial Vintage Road Run 2021</span></span></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"text-align:center; margin:0cm 0cm 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\">Hello folks, my Father-in-Law loves vintage trucks, he always has stories about his Volvo F88 and the left hand drive Volvo F89.&nbsp; According to him, the Daf 2800 was a better machine than the Scania 141, Scania 142 and the Scania 143!</span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\">He drove other trucks including AEC, TK Bedford, Commer, Foden, Guy, Scammell and his favourite was a Dennison.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\">I went to see what the fuss was all about at a road run - check out some of the videos!</span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\">It was a great day out with a great group of people&nbsp;</span></span></span></span></span></p>\r\n<script src=\"https://static.kuula.io/embed.js\" data-kuula=\"https://kuula.co/share/NhjK4?fs=1&vr=1&sd=1&initload=0&thumbs=1&info=0&logo=0\" data-width=\"100%\" data-height=\"640px\"></script><script src=\"https://static.kuula.io/embed.js\" data-kuula=\"https://kuula.co/share/Nhjcw?fs=1&vr=1&sd=1&initload=0&thumbs=1&info=0&logo=0\" data-width=\"100%\" data-height=\"640px\"></script><script src=\"https://static.kuula.io/embed.js\" data-kuula=\"https://kuula.co/share/collection/7k9Lq?fs=1&vr=1&sd=1&initload=0&thumbs=1&info=0&logo=0\" data-width=\"100%\" data-height=\"640px\"></script><script src=\"https://static.kuula.io/embed.js\" data-kuula=\"https://kuula.co/share/NhjK4?fs=1&vr=1&sd=1&initload=0&thumbs=1&info=0&logo=0\" data-width=\"100%\" data-height=\"640px\"></script><script src=\"https://static.kuula.io/embed.js\" data-kuula=\"https://kuula.co/share/Nhjcw?fs=1&vr=1&sd=1&initload=0&thumbs=1&info=0&logo=0\" data-width=\"100%\" data-height=\"640px\"></script><script src=\"https://static.kuula.io/embed.js\" data-kuula=\"https://kuula.co/share/collection/7k9Lq?fs=1&vr=1&sd=1&initload=0&thumbs=1&info=0&logo=0\" data-width=\"100%\" data-height=\"640px\"></script>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><iframe allow=\"xr-spatial-tracking; gyroscope; accelerometer\" allowfullscreen=\"\" frameborder=\"0\" height=\"640\" scrolling=\"no\" src=\"https://kuula.co/share/collection/7k9Lq?fs=1&amp;vr=1&amp;sd=1&amp;initload=0&amp;thumbs=1&amp;info=0&amp;logo=0\" style=\"width: 100%; height: 640px; border: none; max-width: 100%;\" width=\"100%\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><iframe allow=\"xr-spatial-tracking; gyroscope; accelerometer\" allowfullscreen=\"\" frameborder=\"0\" height=\"640\" scrolling=\"no\" src=\"https://kuula.co/share/NhjK4?fs=1&amp;vr=1&amp;sd=1&amp;initload=0&amp;thumbs=1&amp;info=0&amp;logo=0\" style=\"width: 100%; height: 640px; border: none; max-width: 100%;\" width=\"100%\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><iframe allow=\"xr-spatial-tracking; gyroscope; accelerometer\" allowfullscreen=\"\" frameborder=\"0\" height=\"640\" scrolling=\"no\" src=\"https://kuula.co/share/NhjcC?fs=1&amp;vr=1&amp;sd=1&amp;initload=0&amp;thumbs=1&amp;info=0&amp;logo=0\" style=\"width: 100%; height: 640px; border: none; max-width: 100%;\" width=\"100%\"></iframe></p>', '2021-08-16', '', '', '', '', 'assets/uploads/news/', 'af2800162908817461.jpg', 'af2800162908817461.jpg', 1),
(18, 'Acupuncture', 'acupuncture-near-me', 'The Northern Ireland Connection', '<p>What is Acupunture?</p>\r\n\r\n<p><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">Acupuncture is a kind of treatment that includes inserting very thin needles through an individual&#39;s skin at specific points on the body, to numerous depths</span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">Research study suggests that it can help relieve discomfort, and it is used for a vast array of other grievances.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">Acupuncture remains questionable amongst Western medical physicians and scientists.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">What is traditional acupuncture?</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">Acupuncture includes inserting needles at particular points of the body.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">An acupuncturist will place needles into a person&#39;s body with the objective of stabilizing their energy.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">This, it is declared, can help increase wellbeing and may cure some illnesses.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">What kind of conditions can acupuncture help?</span></span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"margin: 0cm 0cm 8pt;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">It can increase overall wellbeing</span></span></span></span></li>\r\n	<li style=\"margin: 0cm 0cm 8pt;\"><span style=\"font-size:11.0pt\"><span style=\"line-height:107%\"><span calibri=\"\" style=\"font-family:\">Alleviate</span></span></span> headaches</li>\r\n	<li style=\"margin: 0cm 0cm 8pt;\">assist to&nbsp;stop smoking</li>\r\n	<li style=\"margin: 0cm 0cm 8pt;\">assist in weight loss</li>\r\n	<li style=\"margin: 0cm 0cm 8pt;\">decrease blodd pressure</li>\r\n</ul>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">How does it work?</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">Traditional Chinese medicine describes that health is the result of a unified balance of the complementary extremes of &quot;yin&quot; and &quot;yang&quot; of the vital force called &quot;qi,&quot; pronounced &quot;chi.&quot; Disease is said to be the repercussion of an imbalance of the forces.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">Qi is stated to flow through meridians, or paths, in the human body. These meridians and energy circulations are accessible through 350 acupuncture points in the body.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">Placing fine needles into these points with appropriate combinations is said to bring the energy flow back into proper balance.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">There is no scientific proof that the meridians or acupuncture points exist, and it is difficult to prove that they either do or do not, but various research studies suggest that acupuncture works for some conditions.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">Some professionals with years of experience have used neuroscience to describe acupuncture. Acupuncture points are viewed as places where nerves, muscles, and connective tissue can be stimulated. The stimulation increases blood circulation, while at the same time triggering the activity of the body&#39;s natural pain relievers.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">It is challenging to set up investigations using appropriate scientific controls, because of the invasive nature of acupuncture. In a scientific research study, a control group would have to go through sham treatment, or a placebo, for results to be compared with those of genuine acupuncture.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">Some research studies have concluded that acupuncture uses comparable benefits to a client as a placebo, however others have shown that there are some real advantages.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\">&nbsp;</p>', '2021-07-16', 'https://www.facebook.com/TheNIConnection/', 'https://twitter.com/theNorthernIre2', 'https://www.instagram.com/thenorthernirelandconnection/', 'https://www.youtube.com/channel/UCY1RtdHHZhNzm0-NV72F7rQ', 'assets/uploads/news/', 'acupunturenearme162939130369.jpg', 'acupunturenearme162939130369.jpg', 1),
(19, 'Best Car Maintenance/Car Body Repair', 'car-repair-near-me', 'The Northern Ireland Connection', '<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">Service, MOT or Repair?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">When getting your car fixed, it is a good idea to go to local garages. Always ring first and check out the customer service, as this will give you a good idea about the rest of business. Tell them you are going to get a second opinion for a competitive price </span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">Involved in an accident?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">Bumper repairs, car body, accident repair always need quality workmanship and if it&rsquo;s threw an insurance claim it&rsquo;s important that you go to an approved garage</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">Car servicing</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">Finding a garage near me is not always straight forward. Just because a garage is conveniently located does not mean it&rsquo;s the best</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">Just because a garage is conveniently located does not mean it&rsquo;s the best</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">Are regular oil changes </span></span></b></span></span></span><strong><span style=\"font-size:16.0pt\"><span style=\"line-height:107%\"><span inherit=\"\" style=\"font-family:\">necessary?</span></span></span></strong></p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">By far, the most requested car service we see is an oil change. Oil changes are one of, if not&nbsp;<i><span style=\"border:none windowtext 1.0pt; padding:0cm\">the</span></i>, most important aspect of car maintenance. You know you have to get your car serviced every 5,000 miles, but do you know why? Your car has thousands of internal components that need constant lubrication to function smoothly. Otherwise, parts will wear down, overheat, and suffer from damage.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">Air Filter Replacement</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">Every time you get behind the wheel, your car starts the combustion process under the hood. If you remember chemistry class from your high school or college days, you know that oxygen is one-third of the combustion process. As your engine draws in oxygen, the air filters prevent other debris from entering the engine and destroying vital internal parts. However, the filter picks up a lot of dust and grime in the process. If too much dirt accumulates on the filters, it will prevent sufficient amounts of air from reaching the engine, thus hindering your engine&rsquo;s performance.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">Check Engine Light Service</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">Nothing is quite as scary as seeing your check engine light unexpectedly turn on. The good news is that this doesn&rsquo;t always mean the damage is centralized to your engine. Sometimes, it could be something as small as a loose fuel cap to a burnt-out sensor. Should you experience a check engine light, the trained professionals can scan your vehicle to determine the cause.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">Brake Replacement</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">Unless you want to be a road hazard to yourself and others, you need to replace your brakes when they get worn down. As a general rule of thumb, brakes should be replaced every 50,000 miles. However, this number can fluctuate based on your driving habits, the road conditions, and the quality of your current brake pads and rotors.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span inherit=\"\" style=\"font-family:\">Do my spark plugs&nbsp;need replacing?</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\">Your vehicle needs three things to start the internal combustion process: fuel, oxygen, and heat. Spark plugs provide electricity to burn fuel, giving your engine life. When your spark plugs wear down, your engine&rsquo;s performance is negatively affected. That&rsquo;s when your car misfires, idles, accelerates slowly, or starts consuming too much fuel.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\">&nbsp;</p>', '2021-08-17', 'https://www.facebook.com/TheNIConnection/', 'https://twitter.com/theNorthernIre2', 'https://www.instagram.com/thenorthernirelandconnection/', 'https://www.youtube.com/channel/UCY1RtdHHZhNzm0-NV72F7rQ', 'assets/uploads/news/', 'carrepairnearme162939112364.jpg', 'carrepairnearme162939112364.jpg', 1);
INSERT INTO `fb_news` (`news_id`, `news_title`, `news_slug`, `news_auhtor`, `news_description`, `news_date`, `news_facebook`, `news_twitter`, `news_instagram`, `news_youtube`, `news_image_path`, `news_image_thumb`, `news_image`, `news_status`) VALUES
(20, 'Dentistry', 'dentist-near-me', 'The Northern Ireland Connection', '<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\">Looking for a Dentist?&nbsp; What about teeth Whitening?</p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">Dental treatment NHS provided</span></span></span></b></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">When you are looking for dental practice that is a NHS dentist, you must remember, like all NHS patients, you will be in for a long wait.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><font face=\"Arial, sans-serif\"><span style=\"font-size: 21.3333px;\"><b>Finding a new dentist</b></span></font></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">A good idea is to visit their website and have a we look. These days, having a great website is one of the most important things. The website should always show the contact details so its proof they have a registered office among other things. </span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">How can I whiten my teeth?</span></span></span></b></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">1. Practice oil pulling (swishing oil around the mouth like mouthwash)</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">2. Brush with baking soda</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">3. Use hydrogen peroxide (diluted with water)</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">4. Eat fruits and vegetables</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">5. Prevent tooth stains before they happen</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">6. Don&rsquo;t underestimate the value of brushing and flossing</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">Other methods that are not proven</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">There are a few other natural teeth whitening methods, but there is no scientific evidence to prove that they are safe or effective.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><u><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">Some of the unproven methods include:</span></span></span></u></b></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">Activated charcoal.</span></span></span></b><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">&nbsp;Brushing with&nbsp;powdered charcoal supposedly pulls toxins</span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">Kaolin clay.</span></span></span></b><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">&nbsp;Proponents of this method claim that brushing with clay helps remove stains from teeth.</span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">Fruit peels.</span></span></span></b><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">&nbsp;Rubbing orange, lemon, Banana peels on your teeth is claimed to make them whiter.</span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"border:none windowtext 1.0pt; font-size:10.5pt; padding:0cm\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">Apple cider vinegar.</span></span></span></b><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">&nbsp;There is no evidence that using vinegar as a mouthwash helps whiten your teeth. On the contrary, it weakens the enamel and promotes tooth decay.</span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:16.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#333333\">The bottom line on teeth whitening</span></span></span></b></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">There are several natural methods to help whiten your teeth. These remedies work by gently removing surface stains on your teeth.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:15.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">However, most dentists offer whitening treatments that are much stronger than these natural remedies. They involve bleaching the teeth, which may be more effective for severe tooth discoloration. Overuse of any whitening product can damage your teeth.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:0cm; margin:0cm 0cm 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span inherit=\"\" style=\"font-family:\"><span style=\"color:#333333\">Always check with your dentist about your options and which would work best for you.</span></span></span></span></span></span></span></p>', '2021-06-15', 'https://www.facebook.com/TheNIConnection/', 'https://twitter.com/theNorthernIre2', 'https://www.instagram.com/thenorthernirelandconnection/', 'https://www.youtube.com/channel/UCY1RtdHHZhNzm0-NV72F7rQ', 'assets/uploads/news/', 'dentistrsnearme162939059922.jpg', 'dentistrsnearme162939059922.jpg', 1),
